  \"2014-10-28T20:54:55.012849\",\n\t\"name\": \"contours-offshore-of-carpinteria-california\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This part of SIM 3261 presents data for
  the bathymetric contours for several seafloor maps (see sheets 1, 2, 3, 5 [in figs.
  1, 2, 3], 7, 10, SIM 3261) of the Offshore of Carpinteria map area, California.
  The vector data file is included in \"Contours_OffshoreCarpinteria.zip,\" which
  is accessible from http://pubs.usgs.gov/ds/781/OffshoreCarpinteria/data_catalog_OffshoreCarpinteria.html.
  The bathymetry and shaded-relief maps of the Offshore of Carpinteria map area, California,
  were generated from bathymetry data collected by California State University, Monterey
  Bay, Seafloor Mapping Lab (CSUMB), by the U.S. Geological Survey (USGS), and by
  Fugro Pelagos for the U.S. Army Corps of Engineers (USACE) Joint Lidar Bathymetry
  Technical Center of Expertise. The southeastern nearshore and shelf areas, as well
  as the western midshelf area, were mapped by CSUMB in the summer of 2007, using
  a 244-kHz Reson 8101 multibeam echosounder. The western nearshore area, as well
  as the western outer shelf area, were mapped by the USGS in 2005 and 2006, using
  117-kHz and 234.5-kHz SEA (AP) Ltd. SWATHplus-M phase-differencing sidescan sonars.
  The nearshore bathymetry and coastal topography were mapped for USACE by Fugro Pelagos
  in 2009, using the SHOALS-1000T bathymetric-lidar and Leica ALS60 topographic-lidar
  systems. All these mapping missions combined to collect bathymetry from the 0-m
  isobath to beyond the 3-nautical-mile limit of California's State Waters. A smooth
  arithmetic mean convolution function applying a weight of one-ninth to each cell
  in a 3-pixel by 3-pixel matrix was then applied iteratively to the grid ten times.
  Following smoothing, contour lines were generated at 10-m intervals, from -10 m
  to -100 m, and at 50-m intervals, from -100 m to -400 m, then the contours were
  clipped to the boundary of the map area.\",\n\t\"license_title\": null,\n\t\"extras\":
